import request from '@/utils/request'; // 查询

export function queryEquipmentEnergy(query) {
  return request({
    url: "/ems/setEquipmentEnergy",
    method: 'get',
    params: query
  });
} // 新增

export function createEquipmentEnergy(data) {
  return request({
    url: "/ems/setEquipmentEnergy",
    method: 'post',
    data: data
  });
} // 更新

export function updateEquipmentEnergy(code, data) {
  return request({
    url: "/ems/setEquipmentEnergy/".concat(code),
    method: 'patch',
    data: data
  });
} // 删除

export function deleteEquipmentEnergy(data) {
  return request({
    url: "/ems/setEquipmentEnergy",
    method: 'delete',
    data: data
  });
} //查询仪表接口

export function queryeQuipmentLedger(query) {
  return request({
    url: "/ems/modelDetail/modelList",
    method: 'get',
    params: query
  });
}
